import React from 'react'

export default function RememberMe() {
    return (
        <div className="Appx">
            <h1>Unuttuğun şifrelerini kaydet</h1>
            <label>Platform:</label>
            <input placeholder="Platform adı"/>
            <label>Şifren</label>
            <input placeholder="Şifren"/>

            <button>Tüm Kaydettiklerimi Göster</button>
        </div>
    )
}
